import styled from "styled-components";
export const Section = styled.section`
  color: #fff;
  display: flex;
  width: 80%;
  flex-direction: row;
  div.featured-post-container {
    color: #fff;
    display: flex;
    width: 80%;
    flex-direction: row;
    img {
      width: 40vw;
    }
  }
`;
